                            Description = "Орехи особенно популярны в качестве зимнего корма для птиц, потому что они долговечны и их легко спрятать для последующего использования. Многие птицы, которые питаются орехами, проводят недели осенью, запасая орехи в полостях коры, небольших углублениях в земле или в других укрытиях. Когда других источников пищи не хватает или плохая погода не позволяет правильно добывать пищу, птицы возвращаются в эти укрытия, чтобы съесть припасенные орехи. Но следует обращать внимание на их использование, так как не все виды орехов одинаково полезны для птиц, а некоторые могут быть вредными. Самыми распространенными орехами, которые могут использоваться в корму для птиц, являются грецкий орех, арахис, миндаль, кешью, фисташки.",
                            ImageSource = "/images/ingredients/nuts.jpg",
                            Name = "Орехи"
                        },
                        new
                        {
                            Id = 17,
                            Description = "Овощи могут быть важным источником питательных веществ в рационе птиц. Наиболее распространены: морковь (богата каротином, который может помочь поддерживать здоровье глаз и кожи у птиц), капуста (содержит много витамина С, кальция, витаминов и минералов), огурцы (богаты водой и могут помочь увлажнить корм птиц), брокколи (содержит много витаминов и минералов, включая витамины А, С и К, а также кальций и железо), тыква (содержит витамин А, калий и другие минералы). Кроме того, овощи, такие как листовые зеленые, помидоры, перец, редис, свекла и многие другие, могут также использоваться в корму для птиц. Важно помнить, что некоторые овощи могут быть токсичными для птиц, поэтому необходимо обращаться к опытным специалистам, чтобы определить, какие овощи лучше всего использовать в рационе для конкретного вида.",
                            ImageSource = "/images/ingredients/vegetables.jpg",
                            Name = "Овощи"
                        },
                        new
                        {
                            Id = 18,
                            Description = "Фрукты могут быть хорошим источником питательных веществ для птиц, но должны использоваться осторожно и только в умеренных количествах. Наиболее популярны: яблоки (источник витамина C, клетчатки, калия и фолиевой кислоты), бананы (богаты калием, витамином С, витамином B6, клетчаткой), груши (источником витамина C, калия, клетчатки), ягоды (черника, малина и клубника богаты антиоксидантами и витаминами C и К), киви (богаты витамином C, клетчаткой и калием), апельсины (содержат много витамина C и клетчатки, фолиевую кислоту и калий). Однако, некоторые фрукты могут быть опасными для птиц, поэтому необходимо быть осторожным. Например, абрикосы, персики, сливы и черешня могут содержать косточки, которые могут быть опасны для птиц. Кроме того, некоторые фрукты могут быть кислыми и вызывать проблемы с желудком у птиц.",
                            ImageSource = "/images/ingredients/fruits.jpg",
